import { HCardBuilderLayout } from "./styled";
import { HCardForm } from "components/HCardForm";
import { HCardView } from "components/HCardView";

export const HCardBuilder = () => {
  const initialState = {
    givenName: "",
    surname: "",
    email: "",
    phone: "",
    houseNameOrNumber: "",
    street: "",
    suburb: "",
    state: "",
    postcode: "",
    country: "",
  };

  const [hCardState, setHCardState] = useState(initialState);

  return (
    <HCardBuilderLayout>
      <HCardForm />
      <HCardView />
    </HCardBuilderLayout>
  );
};
